import React from 'react';
import {BrowserRouter,Routes,Route} from 'react-router-dom';

import Sapling from './components/sapling';

const App=()=>{
    return (
        <div>
            <BrowserRouter>
            {/* <Routes> */}
                <Route path="/sa" component={Sapling} />
                {/* </Routes> */}
                </BrowserRouter>
        </div>
    )
}
export default App;
